Templates.template:
new sap.fe.test.BaseArrangements(
	{
		launchUrl: "${launchUrl}", // string
		launchParameters: ${launchParameters} // Object<string,(string|boolean)>
	}
)

new sap.fe.test.JourneyRunner(
	{
		pages: ${pages}, // Object<string,(sap.fe.test.ListReport|sap.fe.test.ObjectPage)>
		opaConfig: ${opaConfig}, // sap.ui.test.Opa5.Config
		launchUrl: "${launchUrl}", // string
		launchParameters: ${launchParameters}, // Object<string,(string|boolean)>
		async: ${bAsync} // boolean
	}
)

run(
	{
		pages: ${pages}, // Object<string,(sap.fe.test.ListReport|sap.fe.test.ObjectPage)>
		opaConfig: ${opaConfig}, // sap.ui.test.Opa5.Config
		launchUrl: "${launchUrl}", // string
		launchParameters: ${launchParameters}, // Object<string,(string|boolean)>
		async: ${bAsync} // boolean
	},
	"${_vJourneys}" // Array<function()>|string[]
)

new sap.fe.test.ListReport(
	{
		appId: "${appId}", // string
		componentId: "${componentId}", // string
		entitySet: "${entitySet}", // string
		contextPath: "${contextPath}" // string
	},
	"${_aInAdditionalPageDefinitions}" // object
)

new sap.fe.test.ObjectPage(
	{
		appId: "${appId}", // string
		componentId: "${componentId}", // string
		entitySet: "${entitySet}", // string
		contextPath: "${contextPath}" // string
	},
	"${_aAdditionalPageDefinitions}" // object
)
